import React from'react';

function Header(props) {
  var isLoggedIn = true;
  return (
    <div className="Header">
      <div className="headerLeft">
        <h5>New Reddit</h5>
      </div>
      <div className="headerRight">
        <a className="loginButton">Login</a>
      </div>
    </div>
  );
}

export default Header;
